import React from 'react'
import {
    CircleContainer,
    CircleWrapper,
    C
} from './style';


const Circle = () => {
    return (
        <>
            <CircleContainer>
                <CircleWrapper>
                    <CircleImg src='/ICON_PANTS-01a1_120x.png' />
                    <CircleText>ORIGIN PANTS '21</CircleText>
                </CircleWrapper>
            </CircleContainer>
        </>
    )
}

export default Circle
